pragma solidity ^0.4.23;

import "zeppelin-solidity/contracts/token/ERC20/StandardToken.sol"; 

/** 
@title Protocol Token.
@author Entity Protocol
*/
contract ProtocolToken is StandardToken { 
    string public name = "Entity Protocol";  
    string public symbol = "EPXX"; // Test name

    uint public decimals = 18;
    uint public INITIAL_SUPPLY = 3000000 * (10 ** decimals);

    /**
    @dev Constructor, creates a new instance of the token contract
     */
    constructor() public {
        totalSupply_ = INITIAL_SUPPLY;
        balances[msg.sender] = INITIAL_SUPPLY;
    }
}
